webpackJsonp([21943940122865],{1971:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2007-08-08-fashion-can-be-funny/index.md absPath of file >>> MarkdownRemark",html:'<p>I have noticed a lot of women in camouflage pants lately. I think this is the latest fashion or maybe they wear it because they are trying to hide something.</p>\n<p>My bet is that there is a group of fashion designers somewhere in New York. They get together and have coffee and laugh, A LOT. I guess the conversion goes something like this:</p>\n<p>"So Domenique, you win again. I did not think you could pull off the pancho thing, but that was awesome."</p>\n<p>"It was Enrique, and this year I think we should go for the Halloween look. I bet we can get moms to wear what they dressed their boys in last year. Camo anyone?"</p>\n<p>Take a look around next time you are shopping and notice that Enrique won that bet.</p>',frontmatter:{title:"Fashion can be Funny",date:"August 08, 2007",imageUrl:null,structuredHtml:null,image:null}}},pathContext:{}}}});
